DirectPacked64SingleBlockReader(int bitsPerValue, int valueCount,
    IndexInput in) {
  super(valueCount, bitsPerValue);
  this.in = in;
  startPointer = in.getFilePointer();
  valuesPerBlock = 64 / bitsPerValue;
  mask = ~(~0L << bitsPerValue);
}

